"use strict";var e=this&&this.__importDefault||function(e){return e&&e.__esModule?e:{default:e}};Object.defineProperty(exports,"__esModule",{value:!0});var o=e(require("i18next")),a=e(require("i18next-browser-languagedetector")),t=require("react-i18next");o.default.use(a.default).use(t.initReactI18next).init({detection:{order:["navigator"]},resources:{en:{home:{stakhanovite:"Stakhanovite",stakePools:"Stake Pool",reliable:"Your staking partner on Cardano - Simple and **reliable**",who:"Who are we?",first:"One of the first stake pool ever registered on a publicly available testnet, Stakhanovite is operated by **Cardano fans**!\n\nShelley Testnets, Incentivized Shelley ITN, Friends & Family Testnets, Alonzo Blue Testnet ... **We are part of the Cardano experience since day one.**",together:"Together with our Cardano Stake Pool, we also operate an oracle on Cardano.",psychomb:"*\" French translator of various Cardano content such as 'Why Cardano?', IOG Blog posts, or the light wallet Yoroi, I have been a Cardano Ambassador  since day one. Setting up a stake pool was a natural thing to do in order to further support the Cardano Community.* \"",psychomb_sig:"***@psychomb***",alexey:'*" I am a blockchain dev. I hack the ERC20, the ERC21, the Covid 19, the borsch, the cucumber. With bare hands. Enough said already!* "',alexey_sig:"***@Aleksei***",experienceTitle:"What do we offer?",experience:"We offer a **reliable** and **fairly priced** staking experience on the Cardano blockchain that translates into a **painless** and **profitable** ride for all our delegators.",transparentTitle:"We are transparent",transparent:"From our costs to performance reports, you will know everything thanks to our monthly **[newsletter](https://stakhanovite.substack.com/)** and our dedicated **[Telegram](https://t.me/StakhanoviteIO)** channel. Subscribe, and come say hi !",efficientTitle:"We are efficient",efficient:"Since launch, Stakhanovite distributed more than 6 millions ADA rewards to our delegators. We operate since December 2019, uninterrupted. **Try us out and join the crew!**",wallets:"Delegate using the most popular Cardano wallets - [**Daedalus**](https://daedaluswallet.io) or [**Yoroi**](https://yoroi-wallet.com) - and look for the **STKH1** ticker!",faq:"Please read our **FAQ** for more details.",contact:"Contact us",check:"Check the homebar, we are present on Twitter and Telegram!",mail:"You are not of a social media fan?\nDon’t worry, **we got you!**\nPlease send any question you may have to:\n\n**contact@stakhanovite.io**\n\nWe will do our best to answer diligently, in english or in french!",offer:{secureTitle:"Secure",secure:"Hardened servers",robustTitle:"Robust",robust:"High-end network",fairTitle:"Fair",fair:"Low fees"},pool:{margin:"1.8% margin",fixed:"340 ada fixed (min. authorized)",saturation:"Saturation",copyAddress:"Copy pool address",copyId:"Copy Pool ID"},pools:{title:"Our pool",pool1:"Stakhanovite #1",pool2:"Stakhanovite #2"}},faq:{title:"Frequently Asked Questions",general:{title:"Cardano and Proof-of-Stake",cardanoTitle:"What is Cardano?",cardano:"Cardano is a blockchain based on a **proof of stake** (PoS) consensus protocol. Ada is its native cryptocurrency and the security of the Cardano ledger is a common good shared by all **ada** holders. You can take part in the security of the network thanks to the **staking** mechanism.",stakingTitle:"What is staking?",staking:"Anyone with ada can participate in writing the Cardano ledger. That is called **staking** and it is important that an **honest majority** of ada holders participate in this process. To incentivize ada holders to do so, each signed block gives rewards in ada. However, one must run a node 24/7 and stake a very large amount of ada to have any chance of signing blocks **regularly**.",delegationTitle:"What is delegation?",delegation:"If you’re not an ada whale nor tech savvy, you can **delegate your ada to a stake pool using the Cardano wallet of your choice**. The stake pool will run a node on your behalf and the block rewards will be shared in proportion to the amount delegated by each contributor in the pool. The stake pool will charge a fee for this service."},delegation:{title:"Delegation",lockedTitle:"Are my ada locked when I delegate?",locked:"**No.** Your ada are **never locked**. You can spend them as you want while they are delegated.",looseTitle:"Is there a risk to loose my ada by delegating?",loose:"**No.** Delegating is a **safe procedure**. You are simply giving your rights to a pool to sign blocks on your behalf. If your selected pool misbehaves or underperforms, the worst that can happen is missing out on rewards. In that case, **don't forget : you can change pool whenever you want!**",closeTitle:"Can I close my wallet after I delegated?",close:"**Yes.** Once your delegation preference has been posted on-chain, you can safely close you wallet. Come back from time to time to verify that your pool performs as expected!",costTitle:"How much does it cost to delegate?",cost:"Delegating requires to submit a transaction on-chain and this generally costs less than 0.2 ada. **Please note that registering a wallet for staking requires a deposit of 2 ada.** However, this deposit will be returned to you when you de-register your wallet.\n\n**To sum up, your first delegation will cost you less than 2.2 ada. Changing pool later on will only cost the transaction fee  of 0.2 ada.**",feesTitle:"What are the Stakhanovite fees?",fees:"We charge the **minimum fixed fee** allowed by the protocol, and a **margin of 1.8%**.\n            \nIn concrete terms, when you are eligible to receive 100 ada rewards, Stakhanovite will take 1.8 ada and the remaining 98.2 ada are yours."},rewards:{title:"Rewards",expectTitle:"When can I expect to get my rewards?",expect:"**Be patient!** After your first delegation, there is a lag period of **3 full epochs** before receiving any rewards. This means **between 15 to 20 days**, depending when you delegated in the epoch. After that, rewards are paid regularly at the end of **every epoch** (5 days).\n\nThe same lag period exists when you stop delegating. You still receive rewards for the following 3 epochs.",expectMuchTitle:"How much rewards can I expect?",expectMuch:"The protocol gives approximatively **5% annual returns** on your stake. This translates to **~ 0,068% per epoch.**",variationTitle:"Why do my rewards vary between epochs?",variation:"A pool pays rewards according to the number of blocks produced. Each pool is allocated a random number of blocks at each epoch, which explains these variations.",locationTitle:"Where are my rewards deposited?",location:"Your rewards are paid in an **special account address** linked to your wallet. Whether you use Daedalus or Yoroi, the total balance shown by these wallets already includes those rewards.\n\nPlease note that Daedalus automatically retrieves your rewards when you spend your ada (if needed), while Yoroi will ask you to redeem your rewards manually before being able to spend them.",changingTitle:"Will changing pool stop my rewards for several days?",changing:"**No.** However, rewards will come from the previous pool for the following 3 epochs.",redelegateTitle:"Do I have to re-delegate my rewards every five days?",redelegate:"**No.** The entire balance of your wallet is **automatically delegated**. That includes the rewards or any extra ada sent to your wallet after your initial delegation.",trustTitle:"Should I trust my pool to pay the rewards?",trust:"**No.** The protocol will **automatically distribute** the rewards and the pool has no control over this."},wallets:{title:"ADA wallets",whichTitle:"Which wallet should I use?",which:"Cardano offers two main wallets to its users and the choice is yours to make.\n\n[**Daedalus**](https://www.daedaluswallet.io) is a full-node wallet. It downloads the entire blockchain on your computer and verifies the blockchain at all times. This might take time depending on your hardware. **To date, there is no Daedalus available for smartphones.**\n\n[**Yoroi**](https://www.yoroi-wallet.com/) is a light-wallet available on Android, iOS and as an extension for desktop browsers. Yoroi interfaces with the Cardano blockchain through servers maintained by Emurgo. You do not download the entire blockchain and therefore, it is much faster to install and use than Daedalus.",hardwareTitle:"Are hardware wallets supported for storing ada?",hardware:"**Yes. Ledger S, Ledger Nano X and Trezor T** support Cardano and can be used in combination with both Daedalus and Yoroi. Please read the instructions specific to your hardware wallet."}},delegator:{please:"Please enter the reward address⁽*⁾ of your wallet delegated to STKH",store:"**We do not store any personal informations from you!**",input:'Reward address starting with "stake1..."',enter:"Enter",disclaimer:"**⁽*⁾** In **Daedalus, you can find the reward address in the rewards section** of the delegation centre. In **Yoroi, you can find it in the the rewards option of the receive panel**.\n          \nAll data provided are for informations purposes only.",sorry:"**Oops.** It seems that you are not delegating to STKH!",check:'If you did delegate to us, please check that you submitted a valid reward address starting with ***"stake1"***. If your delegation is recent, **retry once you receive rewards from STKH.** Please note that our backend is updated once per hour.',retry:"Retry",welcome:"Welcome!",update:"These statistics are updated every hour. Recent changes might not be immediatly reflected here.",current:"Current Epoch",saturation:"Pool Saturation",number:"Number of Delegators",stake:"My Active Stake",rewards:"My Total Rewards",last:"My Last Rewards",history:"Download History"}},fr:{home:{stakhanovite:"Stakhanovite",stakePools:"Stake Pool",reliable:"Votre partenaire sur Cardano - Simple et **fiable**",who:"Qui sommes-nous ?",first:'L\'un des premiers pools enregistrés sur un testnet public, Stakhanovite est géré par des **fans de Cardano** !\n\nRéseaux de test Shelley, réseau avec récompenses "ITN", réseau de mise au point "Amis et famille", ou encore réseau de test des contrats intelligents "Alonzo-Blue" ... **Nous avons pris et prenons part à Cardano dans toutes ses étapes de développement depuis le premier jour.**',together:"Avec notre Stake Pool Cardano, nous gérons également un oracle sur Cardano.",psychomb:"*\" Traducteur français de divers contenus sur Cardano tels que 'Pourquoi Cardano ?', des articles du blog d'I.O.G., ou du portefeuille Yoroi, je suis Ambassadeur Cardano depuis le premier jour. La mise en place d'un pool était une chose naturelle à faire afin de soutenir davantage la communauté Cardano* \"",psychomb_sig:"***@psychomb***",alexey:"*\" Je suis développeur blockchain. Je pirate l'ERC20, l'ERC21, le Covid 19, le borsch, le concombre. A mains nues. Assez parlé !* \"",alexey_sig:"***@Aleksei***",experienceTitle:"Qu'offrons-nous ?",experience:"Nous offrons une expérience de staking **fiable** et **peu onéreuse** sur la blockchain Cardano. Cela se traduit en une expérience **facile** et **profitable** pour tous nos délégateurs.",transparentTitle:"Transparence",transparent:"De nos coûts jusqu'à nos relevés de performance, vous saurez tout grâce à notre **[newsletter](https://stakhanovite.substack.com/)** mensuelle et à notre **chaîne [Telegram](https://t.me/StakhanoviteIO)** dédiées. Abonnez-vous, et venez nous saluer !",efficientTitle:"Efficacité",efficient:"Depuis son lancement, Stakhanovite a distribué plus de 6 millions d'ADA de récompenses à ses délégateurs. Nous fonctionnons depuis le mois de Décember 2019, sans aucune interruption de service. **Rejoignez-nous !**",wallets:"Déléguez en utilisant les portefeuilles Cardano les plus populaires - [**Daedalus**](https://daedaluswallet.io) ou [**Yoroi**](https://yoroi-wallet.com) - et cherchez notre pool **STKH1** !",faq:"Consultez notre F.A.Q. pour plus de détails.",contact:"Contactez-nous",check:"Vérifiez sur la barre d'accueil, nous sommes présents sur Twitter et Telegram!",mail:"Vous n'êtes pas fans des réseaux sociaux ?\nPas de soucis, **c'est prévu !**\nVeuillez envoyez toutes vos questions à :\n\n**contact@stakhanovite.io**\n\nNous ferons de notre mieux pour répondre dans les plus brefs délais, en français ou en anglais !",offer:{secureTitle:"Sécurisé",secure:"Serveurs renforcés",robustTitle:"Robuste",robust:"Réseau haut-débit",fairTitle:"Juste",fair:"Peu de frais"},pool:{margin:"Marge : 1.8%",fixed:"Frais fixes 340 ada (min. autorisé)",saturation:"Saturation",copyAddress:"Copier",copyId:"Copier l'ID du pool"},pools:{title:"Notre pool",pool1:"Stakhanovite #1",pool2:"Stakhanovite #2"}},faq:{title:"Foire aux Questions",general:{title:"Cardano et Preuve d'Enjeu",cardanoTitle:"Cardano, c'est quoi ?",cardano:"Cardano est une blockchain basée sur un protocole de consensus de **preuve d'enjeu** (Proof of Stake - PoS). Ada est sa crypto-monnaie native et la sécurité du registre Cardano est un bien commun partagé par tous les détenteurs d'**ada**. Vous pouvez participer à la sécurité du réseau grâce au mécanisme de **staking**.",stakingTitle:'Qu\'est-ce que le "staking" ?',staking:"Toute personne possédant des ada peut participer à l'écriture du registre de Cardano. C'est ce qu'on appelle le **staking** et il est important qu'une **majorité honnête** de détenteurs d'ada participe à ce processus. Pour inciter les détenteurs d'ada à le faire, chaque bloc signé donne des récompenses en ada. Pour cela, il faut faire fonctionner un nœud 24h/24 et 7j/7 et mettre en jeu une très grande quantité d'ada pour avoir une chance de signer des blocs **régulièrement**.",delegationTitle:"Qu'est-ce que la délégation ?",delegation:"Si vous n'êtes ni un très gros détenteur d'ada, ni un expert en technologie, vous pouvez **déléguer vos ada à un \"stake pool\" (pool) en utilisant le portefeuille Cardano de votre choix**. Le pool s'occupe de faire fonctionner un nœud validateur et les récompenses des blocs produits seront partagées proportionnellement au montant délégué par chaque contributeur. Le pool facture des frais pour ce service."},delegation:{title:"Délégation",lockedTitle:"Mes ada sont-ils bloqués pendant la délégation ?",locked:"**Non.** Vos ada ne sont **jamais bloqués**. Vous pouvez continuez à les dépenser comme vous le souhaitez lorsqu'ils sont délégués.",looseTitle:"Puis-je perdre des ada pendant la délégation ?",loose:"**Non.** Déléguer est une **procédure sûre**. Vous donnez simplement vos droits à un pool de signer des blocs pour vous. Si votre pool se comporte mal ou valide moins de blocs que prévu, le pire qui puisse arriver est de ne pas toucher de récompenses. Dans ce cas, **n'oubliez pas: vous pouvez changer de pool à tout moment !**",closeTitle:"Est-ce que je peux fermer mon wallet après avoir délégué ?",close:"**Oui.** Une fois que votre préférence de délégation a été enregistrée sur la blockchain, vous pouvez fermer votre portefeuille en toute sécurité. Revenez de temps en temps pour vérifier que votre pool fonctionne comme prévu !",costTitle:"Déléguer, cela coûte combien ?",cost:"Pour déléguer, il faut soumettre une transaction sur la blockchain, ce qui coûte généralement moins de 0,2 ada. **Veuillez noter que l'enregistrement d'un portefeuille nécessite un dépôt de 2 ada**, mais ce dépôt vous sera rendu lorsque vous arrêterez le staking.\n\n**Pour résumer, votre première délégation vous coûtera moins de 2,2 ada. Changer de pool par la suite ne vous coûtera que les frais de transaction de 0,2 ada.**",feesTitle:"Quels sont les frais de Stakhanovite ?",fees:"Nous pratiquons les **frais fixes minimum** autorisés par le protocole, et une **marge de 1.8%.**\n            \nConcrètement, lorsque vous êtes éligibles pour 100 ada de récompenses, Stakhanovite prélèvera 1.8 ada et les 98.2 ada restant sont à vous."},rewards:{title:"Récompenses",expectTitle:"Quand vais-je recevoir mes récompenses ?",expect:"Après votre première délégation, il y a une période de latence de **3 époques complètes** avant de recevoir des récompenses. Cela signifie **entre 15 et 20 jours**, selon le moment où vous avez délégué dans l'époque. Après cela, les récompenses sont payées régulièrement à la fin de **chaque époque** (5 jours).\n\nUn même décalage existe lorsque vous cessez de déléguer. Vous recevrez des récompenses pendant les 3 époques suivantes.",expectMuchTitle:"Combien de récompenses vais-je recevoir ?",expectMuch:"Le protocole donne approximativement **5% de rendement annuel** sur votre enjeu. Cela donne environ **~ 0,068% par époque de 5 jours.**",variationTitle:"Pourquoi mes récompenses varient entre les époques ?",variation:"Un pool paye les récompenses en fonction du nombre de blocs produits. A chaque époque, un nombre aléatoire de blocs est attribué à chaque pool, ce qui explique ces variations.",locationTitle:"Où se trouvent mes récompenses ?",location:"Vos récompenses sont versées dans une **adresse de compte spécial** liée à votre portefeuille. Que vous utilisiez Daedalus ou Yoroi, le solde total affiché par ces portefeuilles inclut déjà ces récompenses.\n\nNotez que Daedalus récupère automatiquement vos récompenses lorsque vous dépensez vos ada (seulement si nécessaire), tandis que Yoroi vous demandera de récupérer vos récompenses manuellement avant de pouvoir les dépenser.",changingTitle:"Si je change de pool, dois-je attendre 3 époques à nouveau ?",changing:"**Non.** Cependant, les récompenses proviendront encore du pool précédent pour les 3 époques suivantes.",redelegateTitle:"Dois-je déléguer à nouveau mes récompenses tous les 5 jours ?",redelegate:"**Non.** Le solde entier de votre portefeuille est **automatiquement délégué**. Cela inclut les récompenses et tous les ada supplémentaires envoyés dans votre portefeuille après votre délégation initiale.",trustTitle:"Dois-je faire confiance à mon pool pour payer les récompenses ?",trust:"**Non.** Le protocole distribue **automatiquement** les récompenses. Le pool n'a aucun contrôle sur ce point."},wallets:{title:"Portefeuilles ADA",whichTitle:"Quel portefeuille utiliser ?",which:"Cardano propose deux portefeuilles principaux à ses utilisateurs et c'est à vous de choisir.\n\n[**Daedalus**](https://www.daedaluswallet.io) est un portefeuille de type nœud-complet. Il télécharge l'intégralité de la blockchain sur votre ordinateur et vérifie la blockchain à tout moment. Cela peut prendre du temps en fonction de votre machine. **A ce jour, Daedalus n'est pas disponible pour les smartphones. Attention aux escroqueries !**\n            \n[**Yoroi**](https://www.yoroi-wallet.com/) est un portefeuille léger disponible sur Android, iOS et comme extension pour les navigateurs web de bureau. Yoroi s'interface avec la blockchain Cardano par le biais de serveurs gérés par Emurgo. Vous ne téléchargez pas la totalité de la blockchain et, par conséquent, il est beaucoup plus rapide à installer et à utiliser que Daedalus.",hardwareTitle:"Les portefeuilles matériels sont-ils pris en charge ?",hardware:"**Oui. Ledger S, Ledger Nano X et Trezor T** prennent tous les trois en charge Cardano et peuvent être utilisés en combinason avec Daedalus ou Yoroi. Lisez attentivement les instructions relatives à votre type de portefeuille."}},delegator:{please:"Veuillez entrer l'adresse de récompenses⁽*⁾ du portefeuille délégué chez STKH",store:"**Nous ne conservons aucune de vos données personnelles !**",input:'Adresse de récompense au format "stake1..."',enter:"Entrer",disclaimer:"**⁽*⁾**Sur **Daedalus, vous pouvez trouver l'adresse de récompense sous l'onglet \"Rewards\" du centre de délégation**. Sur **Yoroi, vous pouvez la trouver dans l'option \"Récompenses\" sous l'onglet Recevoir**.\n\nToutes les données fournies le sont à titre d'information uniquement.",sorry:"Ooops... Nous n'avons pas trouvé votre délégation chez STKH",check:'Si vous avez délégué chez STKH, veuillez vérifier que vous avez bien entré l\'adresse de récompense de votre portefeuille commençant par "***stake1***". Si votre délégation est récente, veuillez recommencer lorsque vous recevrez des récompenses de notre part. Notez que notre service est mis à jour toutes les heures.',retry:"Recommencer",welcome:"Bienvenue !",update:"Ces statistiques sont mises à jour toutes les heures. Des changements récents peuvent ne pas immédiatement être reflétés ici.",current:"Epoque actuelle",saturation:"Saturation du Pool",number:"Nombre de Délégateurs",stake:"Mon Enjeu Actif",rewards:"Récompenses Totales",last:"Dernières Récompenses",history:"Télécharger l'historique"}}},fallbackLng:"en",debug:!0,ns:["home","faq"],defaultNS:"home",interpolation:{escapeValue:!1}}),exports.default=o.default;
